import Header from "../partials/head";
import {GlobalFooter, GlobalNavbar} from "../partials/components";
import React from "react";
import './index.scss'
import './error.scss'

function Error({statusCode}) {
    return (
        <div>
            <Header page_name={statusCode + " Error"}/>
            <GlobalNavbar/>
                <div className={"error-wrapper"}>
                    <span className={"prefix"}>May the</span>
                    <h1 className={"error-large-text"}>
                        {statusCode}
                    </h1>
                    <span className={"prefix"}>be with you.</span>
                </div>
            <GlobalFooter />
        </div>
    )
}

Error.getInitialProps = ({res, err}) => {
    const statusCode = res ? res.statusCode : err ? err.statusCode : 404
    return {statusCode}
}

export default Error
